import React from "react";
import TestimonialCard from "../testimonial/testimonial_card"; // Renamed import to PascalCase
import image1 from "../../assests/testimonial/1.webp";
import image2 from "../../assests/testimonial/2.webp";
import image3 from "../../assests/testimonial/3.jpeg";

const Testimonial = () => {
  const testimonials = [
    {
      image: image1,
      title: "Muhammad Bilal",
      rating: "4.5",
      desc: "The education should be very interactual. Ut tincidunt est ac dolor aliquam sodales. Phasellus sed mauris hendrerit, laoreet sem in, lobortis mauris hendrerit ante.",
    },
    {
      image: image2,
      title: "Ammar",
      rating: "4.5",
      desc: "The education should be very interactual. Ut tincidunt est ac dolor aliquam sodales. Phasellus sed mauris hendrerit, laoreet sem in, lobortis mauris hendrerit ante.",
    },
    {
      image: image3,
      title: "Muhammad",
      rating: "4.5",
      desc: "The education should be very interactual. Ut tincidunt est ac dolor aliquam sodales. Phasellus sed mauris hendrerit, laoreet sem in, lobortis mauris hendrerit ante.",
    },
  ];

  return (
    <div className="">
      {testimonials.map((testimonial, index) => (
        <TestimonialCard
          key={index}
          image={testimonial.image}
          title={testimonial.title}
          rating={testimonial.rating}
          description={testimonial.desc}
        />
      ))}
    </div>
  );
};

export default Testimonial;
